import "./App.css";
import {Route} from 'react-router-dom';
import Home from "./views/Home/Home";
import Landing from "./views/Landing/Landing";

function App() {
  return (
    <div className="App">
      <Route path="/home" />


      <Route exact path="/" component={Landing} />

    </div>
  );
}

export default App;
